import React from 'react';
import styles from './Dashboard.module.css';

function Dashboard() {
    return (
        <div className={styles.dashboardContainer}>
            <h1 className={styles.dashboardTitle}>Bem-vindo à Pizzaria do JayJay</h1>
            <div className={styles.buttonContainer}>
                <button className={styles.dashboardButton}>Opção 1</button>
                <button className={styles.dashboardButton}>Opção 2</button>
                <button className={styles.dashboardButton}>Opção 3</button>
                <button className={styles.dashboardButton}>Opção 4</button>
                <button className={styles.dashboardButton}>Opção 5</button>
            </div>
        </div>
    );
}

export default Dashboard;
